import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the profile section to be present by searching for the profile image (using alt attribute)
    const profileImgSelector = 'img[alt="Jun Kim"]';
    await page.waitForSelector(profileImgSelector, { timeout: 10000 });

    // Scroll profile section into view
    await page.evaluate(() => {
      const el = document.querySelector('img[alt="Jun Kim"]');
      if (el) el.scrollIntoView({ behavior: 'smooth', block: 'center' });
    });

    // Wait for the full name to appear (using text content)
    const fullNameSelector = 'text="Jun Kim"';
    await page.waitForSelector(fullNameSelector, { timeout: 5000 });

    // Wait for the username (using class and text)
    const usernameSelector = '.username';
    await page.waitForSelector(usernameSelector, { timeout: 5000 });

    // Wait for the bio (using class)
    const bioSelector = '.bio';
    await page.waitForSelector(bioSelector, { timeout: 5000 });

    // Wait for the profile stats (using .profile-stats)
    const statsSelector = '.profile-stats';
    await page.waitForSelector(statsSelector, { timeout: 5000 });

    // Take screenshot of the profile section
    const profileHeader = await page.$('.profile-header');
    if (profileHeader) {
      await profileHeader.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_section.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_profile_section.png'));
    }

    // Extract Jun's profile info
    const extractedData = await page.evaluate(() => {
      const imgEl = document.querySelector('img[alt="Jun Kim"]');
      const fullNameEl = document.querySelector('.profile-info h2');
      const usernameEl = document.querySelector('.username');
      const bioEl = document.querySelector('.bio');
      const statsEls = document.querySelectorAll('.profile-stats .stat');
      let stats = {};
      if (statsEls && statsEls.length === 3) {
        stats = {
          orders: statsEls[0].querySelector('.stat-number')?.textContent.trim(),
          reviews: statsEls[1].querySelector('.stat-number')?.textContent.trim(),
          sellerRating: statsEls[2].querySelector('.stat-number')?.textContent.trim()
        };
      }
      return {
        profileImage: imgEl ? imgEl.src : null,
        fullName: fullNameEl ? fullNameEl.textContent.trim() : null,
        username: usernameEl ? usernameEl.textContent.trim() : null,
        bio: bioEl ? bioEl.textContent.trim() : null,
        stats
      };
    });

    // Scroll to Jun's products section (using section h3 text)
    const productsSectionH3 = await page.$('//div[contains(@class,"profile-sections")]//h3[contains(text(),"Products by Jun")]');
    if (productsSectionH3) {
      await productsSectionH3.scrollIntoViewIfNeeded();
      // Wait for at least one product card
      await page.waitForSelector('.profile-sections .products-grid .product-card', { timeout: 5000 });
      // Take screenshot of Jun's products
      const productsGrid = await page.$('.profile-sections .products-grid');
      if (productsGrid) {
        await productsGrid.screenshot({ path: path.join(screenshotsDir, 'step_3_jun_products.png') });
        screenshots.push(path.join(screenshotsDir, 'step_3_jun_products.png'));
      }
    }

    // Extract Jun's products titles
    const junProducts = await page.$$eval(
      '.profile-sections .products-grid .product-title',
      nodes => nodes.map(n => n.textContent.trim())
    );

    // Scroll to Jun's reviews section
    const reviewsSectionH3 = await page.$('//div[contains(@class,"profile-sections")]//h3[contains(text(),"Jun\'s Recent Reviews")]');
    if (reviewsSectionH3) {
      await reviewsSectionH3.scrollIntoViewIfNeeded();
      // Wait for at least one review
      await page.waitForSelector('.profile-sections .reviews-list .review-item', { timeout: 5000 });
      // Take screenshot of Jun's reviews
      const reviewsList = await page.$('.profile-sections .reviews-list');
      if (reviewsList) {
        await reviewsList.screenshot({ path: path.join(screenshotsDir, 'step_4_jun_reviews.png') });
        screenshots.push(path.join(screenshotsDir, 'step_4_jun_reviews.png'));
      }
    }

    // Extract Jun's recent review titles and ratings
    const junReviews = await page.$$eval(
      '.profile-sections .reviews-list .review-item',
      nodes => nodes.map(n => {
        const title = n.querySelector('.review-title')?.textContent.trim() || null;
        const ratingStars = n.querySelector('.stars')?.textContent.trim() || null;
        const product = n.querySelector('.review-product-title')?.textContent.trim() || null;
        return { product, title, ratingStars };
      })
    );

    // Compose extractedData
    extractedData.junProducts = junProducts;
    extractedData.junReviews = junReviews;

    return {
      success: true,
      action: "Harvested Jun's user profile information, including profile details, products, and recent reviews.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
